import React  from "react";
import PosteNote from "./PosteNote";
import PosteVote from "./PosteVote";
import PosteFichier from "./PosteFichier";

function PosteList({posts,setposts})  {

    setposts(posts.sor)
    return <fragment>
        {posts.map((post) =>
           <PosteNote
            post={post}
            />
        )}
        {posts.map((post) =>
            <PosteVote post={post} ></PosteVote>
        )}
         {posts.map((post) =>
            <PosteFichier post={post} ></PosteFichier>
        )}
    </fragment>
}

export default PosteList
